import './App.css'; 
import { AppBar, Container } from '@mui/material';



function App() {
  return (
    <div className="App">
      <header className="App-header">
        <AppBar><p>Here lies the bar of apps</p></AppBar>
      </header>
      <section>
        <div>
        <img src='https://fantasyinmotion.files.wordpress.com/2014/01/dark-soul-witch-fantasy-353840.jpg' />
        </div>
        <div><p>THE</p></div>
        <div><p>FUCK</p></div>        
        </section>
    </div>
  );
}

export default App;
